import React from "react";

const Footer = () => {
    return(
    <footer className="FooterItems bg-black text-white">
        <div className="Icons container py-4">
        <i className="bi bi-instagram"></i>
        <i className="bi bi-threads"></i>
        <i className="bi bi-whatsapp"></i>
        <i className="bi bi-twitter"></i>
        <i className="bi bi-facebook"></i>
        </div>
        <div className="Copyright text-center p-3" style={{ backgroundColor: '#000' }}>
        <img src="./letter-s-white.png" width="60px" height="40px"/>
            <p style={{paddingTop: '30px'}}>&copy; {new Date().getFullYear()} â€¢ Sales Sphere</p>
        </div>
    </footer>
    )
}
export default Footer;
